import React from 'react';

class Recipe extends React.Component <{name: string, image: string}, {}> {

  render() {
    return (
      <div className='recipe-item'>
        <div className='recipe-name'>{this.props.name}</div>
        <img className='recipe-image' src={this.props.image} />
      </div>
    );
  }
}

export default Recipe;
